import React from "react";
import styled from "styled-components";

const StyledLabel = styled.label`
  margin-bottom: 15px;
  font-size: 20px;
  transition: 0.2s;

  &:hover {
    color: blanchedalmond;
    cursor: pointer;
  }
`;

function Label({ children }) {
  return <StyledLabel>{children}</StyledLabel>;
}

export default Label;
